import * as React from 'react';
import styled from '../../../utils/styled';
import classNames from "classnames";
import SquadronModel from "../../../store/squadrons/SquadronModel";

interface RowProps {
    column1: string;
    active: boolean;
    clickItem: () => void;
    column2?: string
    className?: string;
}

const ItemRow: React.FC<RowProps> = ({column1, active, column2, clickItem, className}) => (
    <Wrapper
    >
        {!active ? (<ActiveRow
            className={classNames('MenuItemRow', className)}
            onClick={clickItem}>
            <Column>
               {column1}
            </Column>
            <Column>
              {column2}
            </Column>
        </ActiveRow>) : (<InActiveRow>
            <Column>
                {column1}
            </Column>
            <Column>
                {column2}
            </Column>
        </InActiveRow>)}
    </Wrapper>
);

export default ItemRow;

export const Wrapper = styled('div')`
//display: flex;
//flex-direction: row;
//justify-content: flex-start;
//align-items: center;
//cursor: pointer;
//color: rgba(255, 255, 255, 0.3);
//font-size: 16px;
//width: 100%;
//padding-left: 20px;
`;

const Column = styled('span')`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-content: center;
  width: 100%;
`;


const ActiveRow = styled('div')`
cursor: pointer;
color: rgba(255, 255, 255, 0.3);
width: 100%;
font-size: 16px;
padding-left: 4px;
`;
const InActiveRow = styled('div')`
cursor: default;
color: rgba(255, 255, 255, 0.1);

padding-left: 4px;
`;
